bool is_operator(string &token) {
    char op = token[0];

    return (1 == token.length()) && 
        (('+' == op) ||
         ('-' == op) ||
         ('*' == op) ||
         ('/' == op));
  }

int do_op(int val_1, int val_2, string &token) {
    char op = token[0];

    switch(op) {
      case '+':
        return val_1 + val_2;
      case '-':
        return val_1 - val_2;
      case '*':
        return val_1 * val_2;
      default:  // '/'
        return val_1 / val_2;
    }
  }

